	public static int lengthOfLongestSubstring(String source) {
		if (source == null) {
			return 0;
		}

		int i = 0, j = 0, maxLength = 0, len = source.length();
		Map<Character, Integer> map = new HashMap<Character, Integer>();


		for(;j < len; j++) {
			if(map.containsKey(source.charAt(j))) {
				i = Math.max(map.get(source.charAt(j)), i);
			}
			
			maxLength = Math.max(j - i + 1, maxLength);
			map.put(source.charAt(j), j + 1);
		}
		
		return maxLength;
	}
